import React from "react";


const fname ="sumit"
const lname= "singh" 

const App =()=> {
  return(
    <div><h1>hello world you are tuber</h1>
    <p>my name is sumit singh</p>
    <p>Fav utuber list here</p>
    <ol>
      <li>{fname +" "+lname}</li>
      <li>Flying beast</li>
      <li>{lname}</li>
      <li>saurabh</li>
      <li>tech burner</li>
    </ol>

    </div>
  )
};

export default App;
